import React from "react";




function Card({details})
{

    const cardType = details.type;
    let cardTitle = (cardType=="appointment") ? "Appointment Details" : "Patient Details"; 
    
    let firstRowTitle = (cardType=="appointment")? "Date: " : "Name: ";

    let secondRowTitle = (cardType=="appointment")? "Time: ": "Surname: ";
    
    let thirdRowTitle = (cardType=="appointment")? "Duration: " : "Age: ";

    let forthRowTitle = (cardType=="appointment")? "" : "Email: ";

    return(
        <div style={{marginLeft: "30%", marginTop: "5%", backgroundColor: "#C8FFE0", marginRight:"30%", padding: "10px", borderRadius: "30px"}}>
        <h2 style={{color:"black", textAlign:"center"}}>{cardTitle}</h2>
        <hr />
        <h5>{firstRowTitle} {details.firstRow} </h5>
        <h5>{secondRowTitle} {details.secondRow}</h5>
        <h5>{thirdRowTitle} {details.thirdRow}</h5>
        <h5>{forthRowTitle} {(forthRowTitle=="") ? "": details.forthRow}</h5>
        <hr />
        
        
    </div>


    );



}

export default Card;
